(706, 'b55970adcdbaa6c0c29107d1184efa44', 'a:2:{s:7:\"timeout\";i:1681446326;s:5:\"value\";O:8:\"stdClass\":12:{s:11:\"new_version\";s:6:\"4.3.23\";s:14:\"stable_version\";s:6:\"4.3.23\";s:4:\"name\";s:74:\"Fluent Forms Pro Add-On: The Fastest & Most Powerful WordPress Form Plugin\";s:4:\"slug\";s:13:\"fluentformpro\";s:3:\"url\";s:70:\"https://wpmanageninja.com/downloads/fluentform-pro-add-on/?changelog=1\";s:12:\"last_updated\";s:19:\"2023-02-02 10:58:11\";s:8:\"homepage\";s:58:\"https://wpmanageninja.com/downloads/fluentform-pro-add-on/\";s:7:\"package\";s:0:\"\";s:13:\"download_link\";s:0:\"\";s:8:\"sections\";a:2:{s:11:\"description\";s:14327:\"<p>Fluent Forms is the fastest and most intuitive plugin for WordPress form building. 70+ pre-built templates and the compelling UI will make your form creation fun and playful. Build. Edit. Delete. Easily and effortlessly. From highly customizable drag and drop fields to HubSpot integration, multi-step forms to unique built-in visual data representation - Fluent Forms has it all.<br />\nIncredible Features<br />\nFluent Forms has all the enticing features to make and customize a form for any purpose. Be it a simple contact form or checkout form, you can efficiently build it without any trouble. The new Fluent Forms holds a brilliant set of functionalities to amaze people from different walks of life.&nbsp;</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-input-fields/\" target=\"_blank\" rel=\"noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-input-fields/\" target=\"_blank\" rel=\"noopener\">Ready Input Fields </a><br />\nAll input fields are thoughtfully built, and they\'re meant to fill a particular purpose. Everyone has their own traits.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-form/drag-drop-contact-form-builder/\" target=\"_blank\" rel=\"noopener\"><br />\n								</a><br />\nDrag &amp; Drop Form Builder<br />\nTo build a form, all you have to do is drag the fields you need and drop them to see the magic. Form building was never easier.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-prebuilt-templates/\" target=\"_blank\" rel=\"noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-prebuilt-templates/\" target=\"_blank\" rel=\"noopener\">Pre-built Form Templates</a><br />\nYou know what\'s FUN? Select a template and build a form in no time. Dozens of templates and all are categorized.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-calculated-fields/\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-calculated-fields/\">Calculated Fields</a><br />\nIf you keep options for adding numbers and you need to get them calculated, yes, our form builder plugin can help you out.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-built-in-data-analysis-tool/\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-built-in-data-analysis-tool/\">Visual Data Reporting</a><br />\nBased on the submitted entries, Fluent Forms will create charts to better understand the data for further actions.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-multi-step-forms/\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-multi-step-forms/\">Step Forms</a><br />\nNow cut long forms into multi-step formats. Studies show these forms have elevated conversion rate, and users feel comfort.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-form/multi-column-form-layout/\" target=\"_blank\" rel=\"noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-form/multi-column-form-layout/\" target=\"_blank\" rel=\"noopener\">Multi-column Form Layout</a><br />\nWant to change the typical one-column layout? Use Fluent Forms and introduce a two or three-column layout.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-conditional-logic/\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-conditional-logic/\">Conditional Logic</a><br />\nThis single feature is a highly valuable option that can help you achieve the control you want over your form.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-file-image-upload/\" target=\"_blank\" rel=\"noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-file-image-upload/\" target=\"_blank\" rel=\"noopener\">File &amp; Image Upload</a><br />\nIf you authorize users to upload their files and images, then they can do it. Not to mention it\'s a handy feature sometimes.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-block-spams/\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-block-spams/\">Block Spams &amp; Blank Entries</a><br />\nYou can enable reCAPTCHA for human verification and activate the default option to prevent blank entries.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-scheduling/\" target=\"_blank\" rel=\"noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-scheduling/\" target=\"_blank\" rel=\"noopener\">Form Scheduling &amp; Restriction</a><br />\nSchedule a form when you want to show it\'s in action, and restrain when you don\'t allow users to submit.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-notifications/\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-notifications/\">Automated Form Confirmation</a><br />\nActivate the automated option, and users will receive a message for their successful form submission.</p>\n<p>Conditional Email Notification<br />\nYou\'re never away from your forms. Whenever a form is submitted, both you and your users can get notified if you allow.</p>\n<p>Repeat Fields<br />\nRepeat field is a useful feature for adding multiple fields dynamically. A user can add many of the same fields with this option.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-integration/\" target=\"_blank\" rel=\"noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-integration/\" target=\"_blank\" rel=\"noopener\">45+ 3rd-party Integrations </a><br />\nWith third-party integration, you can make the plugin more powerful and amass more strength in one place.</p>\n<p>Action Hooks for Developers<br />\nIf you\'re a developer, then you know how action hooks work. Add your own input type with action hooks in Fluent Forms.</p>\n<p><a href=\"https://wpmanageninja.com/wp-fluent-forms-sms-notifications/\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/wp-fluent-forms-sms-notifications/\">SMS Notification </a><br />\nWith a Twilio, you can activate SMS notification and let your users know about the submission on their mobile phones.</p>\n<p><a href=\"#\" role=\"button\"><br />\nExplore More<br />\n</a><br />\nEvery 3rd-party integration</p>\n<p>you need in one place!<br />\nWhen you want to add more power to your arsenal with secondary applications, Fluent Forms appears as a formidable contestant. From CRM to email marketing software, project management to conversion tools – Fluent Forms has a powerful list of additional integration.</p>\n<p><a href=\"https://wpmanageninja.com/docs/fluent-form/payment-settings/how-to-integrate-stripe-with-wp-fluent-forms/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/slack-integration-fluentform/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/payment-settings/how-to-integrate-paypal-with-wp-fluent-forms/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-available-in-wp-fluent-form/trello-integration-with-wp-fluent-forms/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/twilio-integration-with-wp-fluent-forms-wordpress-form-builder-plugin/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/activecampaign-integration/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/campaign-monitor-integration/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-available-in-wp-fluent-form/constant-contact-v2-integration-with-wp-fluent-form/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/convertkit-integration-with-wp-fluent-form-plugin/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/getresponse-integration/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/icontact-integration/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/moosend-integration-with-wp-fluent-form-wordpress-form-builder-plugin/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-available-in-wp-fluent-form/mautic-integration-with-wp-fluent-forms/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/zapier-integration/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-available-in-wp-fluent-form/sendinblue-integration-with-wp-fluent-forms/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/mailchimp-integration/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/hubspot-integration-with-wp-fluent-form-wordpress-plugin/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-available-in-wp-fluent-form/wp-fluent-forms-drip-integration/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/webhook-integration/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-available-in-wp-fluent-form/sendfox-integration-with-wp-fluent-forms-plugin/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-availabel-in-wp-fluent-form/mailerlite-integration-with-wp-fluent-form/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-available-in-wp-fluent-form/platformly-integration-in-wp-fluent-forms/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/integrations-available-in-wp-fluent-form/telegram-messenger-integration-with-wp-fluent-forms/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a><br />\n<a href=\"https://wpmanageninja.com/docs/fluent-form/payment-settings/how-to-integrate-mollie-with-wp-fluent-forms/\" target=\"_blank\" rel=\"nofollow noopener\"><br />\n								</a></p>\n<p>AWeber, Dropbox, and <strong>4000+</strong> other integrations via Zapier<br />\nWorks fluently with all the page builders<br />\nFluent Forms is fully compatible with all the WordPress page builders available out there. Meaning, you can use our form builder plugin without any confrontation with the page builder you\'re currently using. It\'s well suited to the major builders and the novel ones.</p>\n<p>Form demos<br />\nSee the example forms to get a solid idea of how they look after the finishing. We have built some demo forms based on the real necessities, and we hope, you can perceive the scenario. Before making the buying decision, have a look at the sample forms.</p>\n<p><a href=\"https://fluentforms.com/forms\" target=\"_blank\" role=\"button\" rel=\"noopener\"><br />\ncheck All Demos<br />\n</a><br />\nIs Fluent Forms really that good?<br />\nIt definitely is! Let’s have a look at what the form builder plugins have to offer.</p>\n<p>[ninja_tables id=\"6492476\"]</p>\n<p style=\"text-align: left;\">&#x2666; Additional paid Add-ons.<br />\n&#x2666; 3rd-party Add-ons</p>\n<p>Happy users, happy developers​<br />\nOne of the best plugin investment ever made<br />\n<em>My investment with Fluent Forms was probably one of the best plugin investments I\'ve ever made. I\'m so thankful to the WPManageNinja team for having made that LTD possible because it\'s now powered the form solution for every single site I\'ve built since - including some sites I\'ve closed for at least $1K more because I was able to create some really neat solutions with Fluent Forms.</em><br />\n<strong>Chris Castillo from <a href=\"https://www.pdms.ca/\" target=\"_blank\" rel=\"noopener\">Propel</a></strong><br />\nFluent Form is just so excellent<br />\n<em>I came in contact with Fluent Forms about 2weeks ago and has change my experience in using forms. The easiest and sweetest plugin available. Also Great support team. Thanks excellent Hasanuzzaman for your support</em><br />\naustinigbe</p>\n<p>.tb_button {padding:1px;cursor:pointer;border-right: 1px solid #8b8b8b;border-left: 1px solid #FFF;border-bottom: 1px solid #fff;}.tb_button.hover {borer:2px outset #def; background-color: #f8f8f8 !important;}.ws_toolbar {z-index:100000} .ws_toolbar .ws_tb_btn {cursor:pointer;border:1px solid #555;padding:3px}   .tb_highlight{background-color:yellow} .tb_hide {visibility:hidden} .ws_toolbar img {padding:2px;margin:0px}<br />\nOne of the best form builder​<br />\n<em>I (have) been using other form builder plugins, and this form builder is easy and it gets the job done. I have switch all my sites to this form builder, and i’m not going back.&nbsp; I have found, and he would be all over it to solve the issue. I recommend this builder, it has everything you need and more. Thank you</em><strong>antoniolucio</strong><br />\nExcellent<br />\nThis is going to replace the current form making plugin I’ve been using since 2012, and I won’t be looking back, it’s that good. And things will only get better with the development of this plugin. Looking forward for the repeat field, among other things. I wish I could give it 6 stars !!!nick6352683</p>\n\";s:9:\"changelog\";s:5123:\"<p>= 4.3.23 (Date: February 02, 2023) =<br />\n- Adds Landing Page Layout Design &amp; Shadow Configurator<br />\n- Adds Copy Button &amp; Email option for Save &amp; Resume Form Link<br />\n- Adds Clickable Form Step<br />\n- Improve Razorpay Modal (color config)<br />\n- Updated File Upload Library<br />\n- Fixes Inventory Issues with Conversational Form<br />\n- Fixes Buddyboss username issue<br />\n- Fixes Airtable br tag issue for textarea field<br />\n- Fixes Twillo SMS Format<br />\n- Fixes Translation Issue For File Upload<br />\n- Fixes Google Sheet &amp; Excel Export Format Issue for Repeater Field<br />\n- Fixes Excel and CSV Format Issue for Checkable Grid<br />\n- Fixes Payment Info on {all.data} shortcode when Product display type is set as Checkbox<br />\n- Fixes Resume Step Form Multiple Choice Field Issue<br />\n- Fixes Address Field’s Country List Mapping with FluentCRM<br />\n- Fixes User Registration Integration’s username issues in URL Slug<br />\n- Fixes Post Update Field’s Placeholder<br />\n- Fixes Range Slider Field’s Required Option<br />\n- Fixes Tags and Lists webhook to work with FluentCRM<br />\n- Fixes Mailjet Custom Field<br />\n- Fixes Post Update Field’s Conditional Logic Issue<br />\n- Fixes Country restriction in google address auto complete</p>\n<p>= 4.3.21 (Date: November 10, 2022) =<br />\n- Fixes Quantity field</p>\n<p>= 4.3.20 (Date: October 27, 2022) =<br />\n- Adds Date field support on HubSpot<br />\n- Fixes negative payment bug<br />\n- Fixes Checkable Grid on Google Sheet<br />\n- Improves UX</p>\n<p>= 4.3.19 (Date: October 21, 2022) =<br />\n- Adds ACF gallery support<br />\n- Adds RazorPay customer prefill</p>\n<p>= 4.3.18 (Date: October 19, 2022) =<br />\n- Fixes ZohoCRM tags support</p>\n<p>= 4.3.17 (Date: October 18, 2022) =<br />\n- Adds HubSpot error handler</p>\n<p>= 4.3.16 (Date: October 16, 2022) =<br />\n- Adds input mask for Repeater field<br />\n- Fixes PayPal IPN<br />\n- Fixes ACF field date section bug<br />\n- Fixes zero value bug for Discord<br />\n- Fixes Repeater field select width issue</p>\n<p>= 4.3.15 (Date: October 10, 2022) =<br />\n- Fixes conditional support<br />\n- Fixes integration failed notification<br />\n- Fixes Google Sheet integration</p>\n<p>= 4.3.14 (Date: October 08, 2022) =<br />\n- Fixes calculation module</p>\n<p>= 4.3.13 (Date: October 07, 2022) =<br />\n- Adds Inventory Management module<br />\n- Adds Coupon Code limitation feature<br />\n- Adds ACF and Metabox support in Post feed<br />\n- Adds Salesforce sandbox support<br />\n- Adds min function to calculations<br />\n- Improves PHP 8 support<br />\n- Improves Quiz module<br />\n- Improves Google Sheet integration<br />\n- Fixes Webhook &lt;br&gt; tag<br />\n- Fixes HubSpot custom field issue<br />\n- Fixes BuddyBoss user registration issue<br />\n- Fixes elementor popup for conditional fields</p>\n<p>= 4.3.12 (Date: September 01, 2022) =<br />\n- Improves translation for receipt page<br />\n- Fixes Resend email notification custom recipient bug<br />\n- Fixes pending payment entry count of additional shortcode<br />\n- Fixes BuddyBoss nickname issue<br />\n- Fixes Zoho CRM: Customized Lead Status Issue<br />\n- Fixes Rich Text input not working in modal<br />\n- Fixes Step Form previous session bug<br />\n- Fixes popup issue for Elementor with conversational form<br />\n- Fixes user update password issue<br />\n- Fixes image upload button issue<br />\n- Fixes Conversational form Phone field country code issue<br />\n- Fixes Rating field option editing bug<br />\n- Fixes Quiz field randomize issue<br />\n- Fixes Conversational form payment bug<br />\n- Fixes iPhone image upload issue conversational form<br />\n- Fixes Step form issue with submit button</p>\n<p>= 4.3.10 (Date: August 04, 2022) =<br />\n- Adds Save &amp; Resume form submission<br />\n- Adds Rich Text Input<br />\n- Adds Insightly Integration<br />\n- Adds Mailster Integration<br />\n- Adds Airtable Multiple table connection<br />\n- Adds email notification for Pending Payment<br />\n- Improves Quiz Module<br />\n- Improves Post Update with ACF<br />\n- Improves User Update with meta fields<br />\n- Improves failed integration notification email<br />\n- Fixes Signature field placement issue<br />\n- Fixes HubSpot API update issue<br />\n- Fixes User Registration password reset email issue<br />\n- Fixes Step form data save issue with Checkable Grid field<br />\n- Fixes Coupon Code issue<br />\n- Fixes ACF image upload with media upload<br />\n- Fixes Constant Contact Issue<br />\n- Fixes br tag issue in Twilio</p>\n<p>= 4.3.9 (Date: July 04, 2022) =<br />\n- Adds User Profile Update feature<br />\n- Adds Partial entry bulk delete<br />\n- Fixes Phone field issue hidden country issue<br />\n- Fixes Payment method conditional logic issue<br />\n- Fixes taxonomy field default value issue<br />\n- Fixes Post update dynamic default value<br />\n- Fixes Range slider issue on the same page</p>\n<p>= 4.3.8 (Date: June 02, 2022) =<br />\n- Fixes Post update taxonomy issue<br />\n- Adds MailJet integration<br />\n- Fixes Pipedrive custom field issue<br />\n- Fixes zero custom payment issue<br />\n- Fixes payment styling issue</p>\n\";}s:7:\"banners\";s:41:\"a:2:{s:4:\"high\";s:0:\"\";s:3:\"low\";s:0:\"\";}\";s:5:\"icons\";s:224:\"a:2:{s:2:\"1x\";s:92:\"https://wpmanageninja.com/wp-content/uploads/edd/2021/05/fluentforms-pro-banner-download.png\";s:2:\"2x\";s:92:\"https://wpmanageninja.com/wp-content/uploads/edd/2021/05/fluentforms-pro-banner-download.png\";}\";}}', 'no'),
